import React from "react";
import "./styles.css";
import About from "./components/About";
import Categorical from "./components/Categorical";
import GenderCrimes from "./components/GenderCrimes";
import GenderCrimesVsNonGenderCrimes from "./components/GenderCrimes";
import IncomeRelatedVariables from "./components/IncomeRelatedVariables";
import VizNavigation from "./components/VizNavigation";
import TimeSeries from "./components/TimeSeries";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import 'bootrap/scss/bootstrap.scss';
import 'bootstrap-sidebar-menu/dist/sidebar-menu.scss';
export default function App() {
  return (
    <Router>
      <div className="App">
        <VizNavigation />
        <Routes>
          <Route path="/" exact component={About} />
          <Route path="/categorical" component={Categorical} />
          <Route path="/gender-violence" component={GenderCrimes} />
          <Route path="/gender-crime-against-crime-overall" component={GenderCrimesVsNonGenderCrimes} />
          <Route path="/income-and-crime" component={IncomeRelatedVariables} />
          <Route path="/time-series-analysis" component={TimeSeries} />
        </Routes>
      </div>
    </Router>
  );
}

function Home() {
  return <h1>Home page</h1>;
}
